import React from "react";
import styled from "styled-components";
const Home = () => {
  return (
    <>
    <Wrapper>
      <StyledLeaderBoard>
        <h2>Leader board</h2>
      </StyledLeaderBoard>
      <StyledTopPaths>
        <h2>Top Paths</h2>
      </StyledTopPaths>
    </Wrapper>
    </>

  );
};

const Wrapper = styled.div`
  font-size: 2rem;
  height: 90vh;
  border: 1px solid red;
  display: flex;
`;

const StyledLeaderBoard = styled.div`
  font-size: 2.8rem;
  width: 45%;
  height: 40vh;
  background: white;
  border: 10px solid blue;
  margin: 2rem 2rem;
`;

const StyledTopPaths = styled(StyledLeaderBoard)``;

const StyledMap = styled(StyledLeaderBoard)``;
export default Home;
